import React, { Component } from 'react';
import NavbarItem from './NavbarItem';

class Navbar extends Component {
  render() {
    const NavbarTitles = {
      titles: ['Pokemons', 'Types'],
    };
    return NavbarTitles.map(<NavbarItem />);
  }
}

export default Navbar;
